import { View, Text, ScrollView } from "react-native";

import  LinearGradient  from "react-native-linear-gradient";

const FadeMask = ({ height }) => {
  return (
    <View
      style={{
        position: "absolute",
        bottom: 0,
        left: 0,
        right: 0,
        height: height,
      }}
    >
      <LinearGradient
        colors={["transparent", "black"]}
        style={{ flex: 1 }}
        start={{ x: 0, y: 0 }}
        end={{ x: 0, y: 1 }}
      >
        <Text>FadeMask</Text>
      </LinearGradient>
    </View>
  );
};

export default FadeMask;
